import React from 'react';
import { useNavigate } from 'react-router-dom';

const MainPage = () => {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    navigate('/uploadPage'); // Navigates to /uploadPage
  };

  return (
    <div>
      <h1>Main Page</h1>
      <button onClick={handleButtonClick}>Go to Upload Page</button>
    </div>
  );
};

export default MainPage;
